import React, { useEffect, useState } from "react";
import { List, Header, Rating } from "semantic-ui-react";

export const ViewAllGames = () => {
  const [games, setGames] = useState([]);

  useEffect(() => {
    fetch("/basic_game_data").then(response =>
      response.json().then(data => {
        console.log(data.games)
        setGames(data.games);
      })
    );
  }, []);

  return (
    <List>
      {games.map(game => {
        return (
          <List.Item key={game.game_id}>
            <Header>{game.game_id}</Header>
            <Header>{game.game_id}</Header>
            <Header>{game.game_id}</Header>
            <Header>{game.game_id}</Header>
            {game.game_icon}
          </List.Item>
        );
      })}
    </List>
  );
};
